let canvas = document.querySelector('.canvas1');
let context = canvas.getContext('2d');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
window.addEventListener('resize', () => {
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;
});

//let us define mouse position and it's radius 
let mouse = {
    x: undefined,
    y: undefined,
    radius: 80
};

canvas.addEventListener('mousemove', (event) => {
    mouse.x = event.x;
    mouse.y = event.y;
});

//create an empty particle array
let particleArray = [];

//draw the image on the canvas 
let image = new Image();
image.src = "data:image/png;base64,";

let imgWidth = image.width;
let imgHeight = image.height;

//until the image does not load on the screen we can not collect the data of the image and we will get an error that the source width is 0
window.addEventListener('load', () => {
    imgWidth = image.width;
    imgHeight = image.height;
    context.drawImage(image, 0, 0, imgWidth, imgHeight);
    //converting the above image into particles using cutom particle class
    convertToParticles();
});

function convertToParticles() {
    //collect the data of the image in the specified area
    let scannedImage = context.getImageData(0, 0, imgWidth, imgHeight);
    let scannedImageData = scannedImage.data;
    //now remove the image from the screen because we will create particles instead of this image on the canvas
    context.clearRect(0, 0, imgWidth, imgHeight);
    //now create a function that will iterate over the scanned Image object and will feed the required data to the particles array that we will create on the screen using custom particle class. (It will feed the data such as the x-coordinate of pixel, y-coordinate of a pixel and color of each pixel)
    function init() {
        //create an empty particle array
        particleArray = [];
        //iterate over the bitmap image pixels
        for (let y = 0; y < scannedImage.height; y++) {
            for (let x = 0; x < scannedImage.width; x++) {
                //now for alpha values > 128 we will create particles
                if (scannedImageData[(y * 4 * scannedImage.width) + (x * 4) + 3] > 0) {
                    let imageX = x;
                    let imageY = y;
                    let color = `rgb(${scannedImageData[(y * 4 * scannedImage.width) + (x * 4)]}, ${scannedImageData[(y * 4 * scannedImage.width) + (x * 4) + 1]}, ${scannedImageData[(y * 4 * scannedImage.width) + (x * 4) + 2]})`;
                    particleArray.push(new Particle(imageX, imageY, color));
                }
            }
        }
        console.log(particleArray);
    }

    class Particle {
        constructor(x, y, color) {
            this.x = x + canvas.width/2 - imgWidth/2;
            this.y = y + canvas.width/2 - imgHeight/2;
            this.size = 1;
            this.color = color;
            this.initialX = x + canvas.width/2 - imgWidth/2;
            this.initialY = y + canvas.height/2 - imgHeight/2;
            this.density = Math.random()*10 + 12;
        }
        draw() {
            context.beginPath();
            context.fillRect(this.x, this.y, this.size, this.size);
            context.closePath();
            context.fill();
        }
        update() {
            context.fillStyle = this.color;
            let dx = mouse.x - this.x;
            let dy = mouse.y - this.y;
            let distance = Math.sqrt(dx * dx + dy * dy);
            //Now let us find the force direction in x dimension
            let forceDirectionX = dx / distance;      //value between [-1, 1] as it is representing sin(theta)
            //Now let us find the force direction in x dimension
            let forceDirectionY = dy / distance;      //value between [-1, 1] as it is representing cos(theta)

            var maxDistance = 80;
            var force = (maxDistance - distance) / maxDistance;

            // if we go below zero, set it to zero.
            if (force < 0) force = 0;

            let directionX = (forceDirectionX * force * this.density) * 0.9;
            let directionY = (forceDirectionY * force * this.density) * 0.9;

            if (distance < mouse.radius) {
                this.x -= directionX;
                this.y -= directionY;
            }
            else {
                if (this.x !== this.initialX) {
                    let dx = this.x - this.initialX;
                    let dy = this.y - this.initialY;
                    this.x -= dx/5;
                } if (this.y !== this.initialY) {
                    let dx = this.x - this.initialX;
                    let dy = this.y - this.initialY;
                    this.y -= dy/5;
                }
            }
            this.draw();
        }
    };
    function animate() {
        requestAnimationFrame(animate);
        context.clearRect(0, 0, canvas.width, canvas.height);
        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
        }
    }
    init();
    animate();
};